test_Liver_gt, test_Tumors_gt = [], []
for string in test_CT:
    liver_file = string.replace("scan", "liver")
    if not os.path.isfile(liver_file):
        liver_file = string.replace("scan", "liver_pred")
    test_Liver_gt.append(liver_file)
    test_Tumors_gt.append(string.replace("scan", "tumors"))

if len(test_CT) != len(test_Liver_gt):
    raise Exception('The number of CT files is not equivalent to the number of Liver files.')

if len(test_CT) != len(test_Tumors_gt):
    raise Exception('The number of CT files is not equivalent to the number of Tumors files.')

if np.any(np.array(test_CT) == np.array(test_Liver_gt)):
    raise Exception('There is CT files and Liver files that are the same.')

if np.any(np.array(test_CT) == np.array(test_Tumors_gt)):
    raise Exception('There is CT files and Tumor files that are the same.')

